import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import titleLogo from "../../images/shittybookicon.svg";
import dropDownLogo from "../../images/shittydropdown.svg";

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);

  const handleNavbar = () => setToggleMenu(!toggleMenu);

  return (
    <nav className="flex first-letter:font-radiocanada"  id="navbar">
      <div className="idk">
        <div className="brand-and-toggler">
          <Link to="/" className="navbar-brand">
            <img src={titleLogo} alt="site logo" height={50} width={50} />
            <p className="site-title">Magic Library</p>
          </Link>
        </div>
        <div className={toggleMenu ? "navbar-show" : "navbar-collapse"}>
          <button
            type="button"
            className="navbar-toggler"
            onClick={handleNavbar}
          >
            <img
              src={dropDownLogo}
              alt="drop down logo"
              height={50}
              width={50}
            />
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;


